import { Component, OnInit } from '@angular/core';
import { GlobalStyles } from './css-reset.styles';

@Component({
  selector: 'css-reset',
  template: ` <div><ng-content></ng-content></div> `,
  styles: [],
})
export class CssResetComponent implements OnInit {
  ngOnInit(): void {
    GlobalStyles();
  }
}

import { Component, OnInit, Input } from '@angular/core';
import {
  VenusBreadcrumbStyle,
  VenusBreadcrumbList,
  VenusBreadcrumbItem,
} from './venus-breadcrumb.styles';
import { Router } from '@angular/router';

@Component({
  selector: 'venus-breadcrumb',
  template: `
    <div [ngClass]="[style]">
      <ul [ngClass]="[list]">
        <li *ngFor="let path of paths" [ngClass]="[item]">
          <a *ngIf="router.url === path.endpoint">{{ path.name }}</a>
          <ng-container *ngFor="let child of path.child">
            <ng-container *ngIf="router.url === child.endpoint">
              <a>{{ path.name }}</a>
              <strong>></strong>
              <a>{{ child.name }}</a>
            </ng-container>
          </ng-container>
        </li>
      </ul>
    </div>
  `,
  styles: [],
})
export class VenusBreadcrumbComponent implements OnInit {
  constructor(public router: Router) {}
  style: string = '';
  list: string = '';
  item: string = '';

  @Input() paths: Array<any> = [];

  ngOnInit() {
    console.log(this.router.url);
    this.style = VenusBreadcrumbStyle().className;
    this.list = VenusBreadcrumbList().className;
    this.item = VenusBreadcrumbItem().className;
  }
}

import { Component, Input, OnInit } from '@angular/core';
import { VenusButtonStyle } from './venus-button.styles';

@Component({
  selector: 'venus-button',
  template: `
    <button [ngClass]="[style]" [disabled]="isDisabled" [type]="type">
      <ng-content></ng-content>
    </button>
  `,
  styles: [],
})
export class VenusButtonComponent implements OnInit {
  @Input() type: 'button' | 'reset' | 'submit' = 'button';
  @Input() bg: 'primary' | 'secondary' | 'danger' | 'warning' | 'success' =
    'primary';
  @Input() size: 'sm' | 'md' | 'lg' = 'md';
  @Input() isDisabled: boolean = false;
  @Input() full: boolean = false;
  style: string = '';

  ngOnInit(): void {
    let props: any = { bg: this.bg, size: this.size };
    if (this.full) {
      props.width = 'full';
    }

    this.style = VenusButtonStyle(props).className;
  }
}

import { Component, Input, OnInit } from '@angular/core';
import { VenusCardStyle } from './venus-card.styles';

@Component({
  selector: 'venus-card',
  template: `
    <article [ngClass]="[style]">
      <ng-content></ng-content>
    </article>
  `,
  styles: [],
})
export class VenusCardComponent implements OnInit {
  style: string = '';

  @Input() full: boolean = false;
  @Input() radius: 'sm' | 'md' | 'lg' = 'sm';

  ngOnInit(): void {
    if (this.full) {
      this.style = VenusCardStyle({
        size: 'full',
        radii: this.radius,
      }).className;
      return;
    }
    this.style = VenusCardStyle({ radii: this.radius }).className;
  }
}

import { Component, OnInit } from '@angular/core';
import { VenusCardContentStyle } from './venus-card-content.styles';

@Component({
  selector: 'venus-card-content',
  template: `
    <section [ngClass]="style">
      <ng-content></ng-content>
    </section>
  `,
  styles: [],
})
export class VenusCardContentComponent implements OnInit {
  style: string = '';

  ngOnInit() {
    this.style = VenusCardContentStyle().className;
  }
}

import { Component, Input, OnInit } from '@angular/core';
import { VenusCardHeaderStyle } from './venus-card-header.styles';

@Component({
  selector: 'venus-card-header',
  template: `
    <header [ngClass]="style">
      <h2>{{ title }}</h2>
      <ng-content></ng-content>
    </header>
  `,
  styles: [],
})
export class VenusCardHeaderComponent implements OnInit {
  @Input() title!: string;
  style: string = '';

  ngOnInit() {
    this.style = VenusCardHeaderStyle().className;
  }
}

import {
  Component,
  Input,
  ChangeDetectionStrategy,
  ElementRef,
  OnInit,
  HostBinding,
} from '@angular/core';
import { VenusIcons } from './venus-icons';
import { VenusIconStyle } from './venus-icon.styles';

@Component({
  selector: 'venus-icon',
  template: `<ng-content></ng-content>`,
  styles: [],
  changeDetection: ChangeDetectionStrategy.OnPush,
})
export class VenusIconsComponent implements OnInit {
  constructor(private element: ElementRef) {}

  @Input() set name(iconName: string) {
    this.element.nativeElement.innerHTML = VenusIcons[iconName] || null;
  }

  @Input() color: 'dark' | 'light' | 'primary' = 'dark';
  @Input() size: 'small' | 'large' = 'small';
  style: string = '';

  ngOnInit(): void {
    this.style = VenusIconStyle({
      fill: this.color,
      size: this.size,
    }).className;
  }

  @HostBinding('class') get IconClass() {
    return this.style;
  }
}

import { Component, Input, OnInit } from '@angular/core';
import { VenusInputStyle } from './venus-input.styles';

@Component({
  selector: 'venus-input',
  template: `
    <input
      [placeholder]="placeholder"
      [disabled]="isDisabled"
      [ngClass]="style"
      [name]="name"
      [type]="type"
      value=""
    />
  `,
  styles: [],
})
export class VenusInputComponent implements OnInit {
  @Input() type: 'text' | 'number' | 'password' = 'text';
  @Input() name: string = '';
  @Input() placeholder: string = '';
  @Input() isDisabled: boolean = false;
  style: string = '';

  ngOnInit() {
    this.style = VenusInputStyle().className;
  }
}

