  declarations: [
    CssResetComponent,
    VenusButtonComponent,
    VenusInputComponent,
    VenusIconsComponent,
    VenusBreadcrumbComponent,
    VenusCardComponent,
    VenusCardHeaderComponent,
    VenusCardContentComponent,
  ],
  imports: [CommonModule, RouterModule],
  exports: [
    CssResetComponent,
    VenusButtonComponent,
    VenusInputComponent,
    VenusIconsComponent,
    VenusBreadcrumbComponent,
    VenusCardComponent,
    VenusCardHeaderComponent,
    VenusCardContentComponent,
  ],
})
export class VenusModule {}

